import React from 'react'
import './index.css';

const Header = () => {
  return (
    <div>
      <div className="search">
        <input
          // style={{border:'none'}}
          className=''
          type="text"
          placeholder="Search"
        />
        <button className="searchButton">
          <img src='./images/searchButton.png'></img>
        </button>
      </div>
    </div>
  )
}

export default Header
